  return (
    <>
      <div className="container">
        <div className="col projectCard bg-secondary rounded-4 p-3">
          <div className="container text-light ">
            <p>{data.pName}</p>
            <p>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Quisquam,
              exercitationem. Dolorem, harum recusandae aliquid iure tempora
              minima a nihil laborum laboriosam rerum tenetur eaque vel at enim
              unde corporis tempore.
            </p>
          </div>
        </div>
      </div>
    </>
  );
}

export default ProjectCard;
